import React, { Component } from "react";
import { TextField } from "@material-ui/core";

export class Login extends Component {
  render() {
    return (
      <div>
        <div>
          <TextField
            id="outlined-full-width"
            label="Label"
            style={{ margin: 8 }}
            placeholder="Placeholder"
            helperText="Full width!"
            fullWidth
            margin="normal"
            InputLabelProps={{
              shrink: true,
            }}
            variant="outlined"
          />
        </div>
      </div>
    );
  }
}

export default Login;
